To determine if a given graph is a tree, we can use a depth-first search (DFS) approach. Here's a Python implementation that addresses the problem:

```python
class Solution:
    def isTree(self, graph: List[List[int]]) -> bool:
        # Initialize visited and parent arrays
        visited = [False] * len(graph)
        parent = [-1] * len(graph)

        # Helper function to perform DFS
        def dfs(node):
            nonlocal visited, parent
            visited[node] = True
            for neighbor in graph[node]:
                if not visited[neighbor]:
                    parent[neighbor] = node
                    dfs(neighbor)
                else:
                    return True

        # Perform DFS on all nodes
        for i in range(len(graph)):
            if not visited[i]:
                dfs(i)

        # Check if the number of parents is exactly one
        return len(set(parent)) == 1 and parent.count(-1) == len(graph)
```

