// Function to read data from Kafka topic
std::vector<std::tuple<std::string, std::string, std::string>> readKafkaData(const std::string& kafkaTopic) {
    std::ifstream file(kafkaTopic);
    if (!file.is_open()) {
        throw std::runtime_error("Failed to open the Kafka topic");
    }

    std::vector<std::tuple<std::string, std::string, std::string>> data;
    std::string line;
    while (std::getline(file, line)) {
        std::istringstream iss(line);
        std::string key, value;
        if (!(iss >> key) || !(iss >> value)) {
            continue;
        }
        data.push_back(std::make_tuple(key, value));
    }

    return data;
}

