### Challenge 1: Recursive Function

```python
import math

def calculate_geometric_progression_sum(a, r, n):
    if n == 0:
        return a * (1 - r**n) / (1 - r)
    else:
        return calculate_geometric_progression_sum(a * r, r, n - 1)

# Example usage
a = 5  # Starting term
