using System.Security.Cryptography;
using System.Text;
using System.Linq;
using System.Collections.Generic;
using System.Diagnostics;
using System.Numerics;
using System;

class UserInterfacePermissionManager {
    // Define the UserInterfacePermission enum with the given values
    public enum UserInterfacePermission {
        None = 0,
        View = 1,
        Edit = 2,
        Delete = 4,
        All = View | Edit | Delete
    }

    // Method to check if a user has the required permission for a UI element
    public bool CheckPermission(UserInterfacePermission userPermission, UserInterfacePermission requiredPermission) {
        return (userPermission & requiredPermission) == requiredPermission;
    }
}

class Program {
    static void Main(string[] args) {
        // Example usage
        UserInterfacePermissionManager manager = new UserInterfacePermissionManager();
        Console.WriteLine(manager.CheckPermission(UserInterfacePermission.View, UserInterfacePermission.Edit));  // Output: True
        Console.WriteLine(manager.CheckPermission(UserInterfacePermission.View, UserInterfacePermission.Delete));  // Output: False
    }
}
