func setIntersection(s1: Set<Int>, s2: Set<Int>) -> Set<Int> {
    // Create an empty dictionary
    var dict_s = [Int: Int]()

    // Iterate over the first set and add each of its elements to the dictionary
    for i in s1 {
        if !dict_s[i] {
            dict_s[i] = 1
        }
