    // its added to the intersection
    var result: [Int] = []
    for i in s2 {
        if let existingElement = dict_s[i], !existingElement {
            result.append(i)
            dict_s.removeValue(forKey: i, force: true)  // Remove the element to prevent duplicates
        }
    }

    // Sort the resulting list and then convert it to a set to remove duplicates
    return Set(result.sorted())
}
