def vending_machine(items, item, money):
    selected_item = None
    change = 0

    for item_name, price in items.items():
        if item == item_name:
            selected_item = item
            break

    if selected_item is not None and money >= price:
        change = money - price
        return (selected_item, change)
    else:
        return ('', 0)

