To reverse a string without using built-in methods like `reverse()`, we can use an iterative approach with two pointers. Here's how you can do it:

1. Initialize two pointers, one at the start (`start`) and another at the end of the string (`end`).
2. While the `start` pointer is less than the `end` pointer:
   - Swap the characters at these positions.
   - Increment both the `start` and `end` pointers.
3. Continue this process until the `start` pointer surpasses the `end` pointer.

Here's a JavaScript implementation of the solution:

```javascript
function reverseStringWithoutBuiltIn(str) {
    let start = 0;
    let end = str.length - 1;

    while (start < end) {
        // Swap characters at the current positions
        [str[start], str[end]] = [str[end], str[start]];

        // Move both pointers towards the center
        start++;
        end--;
    }

    return str;
}

// Example usage:
const inputString = "Hello, World!";
const reversedString = reverseStringWithoutBuiltIn(inputString);
console.log(reversedString);  // Output: "!dlroW ,olleH"
```

