// Define a helper function to check if a number is prime
function isPrime(num) {
    // Check if num is less than 2, in which case it's not prime
    if (num < 2) return false;

    // Check divisibility from 2 to the square root of num
    for (let i = 2; i * i <= num; i++) {
        if (num % i === 0) return false;
    }

    // If no divisors are found, num is prime
    return true;
}

// Define the main function that calculates the sum of first N prime numbers in an array
function sumOfFirstNPrimes(arr, n) {
    let sum = 0;
    let count = 0;

    for (let num of arr) {
        if (isPrime(num)) {
            sum += num;
            count++;

            // If we've found N prime numbers, break the loop
            if (count === n) break;
        }
    }

    return sum;
}

