def isTree(graph):
    # Check if graph is connected
    visited = [False for _ in range(len(graph))]
    dfs(graph, 0, visited)

    # If any node was not visited, the graph is not connected
    if False in visited:
        return False

    # Check if there is more than one path between any two nodes
    for i in range(len(graph)):
        if not visited[i]:
            continue
        stack = [(i, [i])]
        while stack:
            node, path = stack.pop()
            for neighbor in graph[node]:
                if neighbor not in path and not visited[neighbor]:
                    stack.append((neighbor, path + [neighbor]))
                    if len(stack) > 1: # more than one path
                        return False

    return True

def dfs(graph, node, visited):
    visited[node] = True
    for neighbor in graph[node]:
        if not visited[neighbor]:
            dfs(graph, neighbor, visited)

def isTree(graph):
    def dfs(node, parent):
        visited.add(node)
        for neighbor in graph[node]:
            if neighbor == parent:
                continue
            if neighbor not in visited:
                return False
            if len(visited) > 1:
                return False
            if not dfs(neighbor, node):
                return False
        return True

    n = len(graph)
    visited = set()
    for i in range(n):
        if i not in visited:
            if not dfs(i, -1):
                return False
    return len(visited) == n

