    """
    Calculate the terms of a geometric progression given sum and common ratio.

    Args:
        sum_terms (float): The sum of the geometric progression.
        common_ratio (float): The common ratio of the geometric progression.

    Returns:
        list: A list of terms in the geometric progression.
    """

    def recursive_formula(a, r, n):
        # Base case
        if n == 1:
            return a

        # Recursive case
        else:
            return (a * r) + recursive_formula(a * r, r, n - 1)

    # Calculate the first term 'a'
    try:
        a = sum_terms / ((common_ratio ** n) - 1) / common_ratio for n in range(1, 1000)
    except ZeroDivisionError:
        raise ValueError("Common ratio cannot be 1.")

    return [recursive_formula(a, common_ratio, i + 1) for i in range(5)]


