def calculate_area(a, b, h):
    return (a + b) / 2 * h

def calculate_height(a, b, c):
    # Calculate height using Pythagorean theorem for isosceles or right-angled trapezoids
    if a == b:
        return math.sqrt(c**2 - ((b-a)/2)**2)
    else:
        return math.sqrt(c**2 - (h**2 + ((b-a)/2)**2))

def calculate_perimeter(a, b, h, c):
    # Calculate perimeter using the lengths of the parallel sides and slant height
    if a == b:
        return 2 * a + 2 * c
    else:
        return a + b + 2 * math.sqrt(c**2 - (h**2 + ((b-a)/2)**2))

