func setIntersection(_ s1: Set<Int>, _ s2: Set<Int>) -> Set<Int> {
    var dictS = [Int: Int]()

    // Iterate over the first set and add each of its elements to the dictionary
    for element in s1 {
        if !dictS.contains(element) {
            dictS[element] = 1
        }
    }

    // Now iterate over the second set.
    // If an element from second set already exists in the dictionary,
    // its added to the intersection
    var result: [Int] = []
    for element in s2 {
        if let count = dictS[element], count > 0 {
            result.append(element)
            dictS[element] = 0
        }
    }

    // Sort the resulting list and then convert it to a set to remove duplicates
    return Set(result).sorted()
}
