def vending_machine(items, item, money):
    """
    Simulates a simple vending machine.

    Args:
        items (dict): A dictionary containing the available items as keys and their prices as values.
        item (str): The item selected by the user.
        money (float): The amount of money inserted by the user.

    Returns:
        tuple: A tuple containing the selected item and any change due to the user.
    """

    # Check if the selected item is available
    if item in items:
        # Calculate the cost of the selected item
        cost = items[item]

        # Check if the user has inserted enough money for the selected item
        if money >= cost:
            # Calculate the change due to the user
            change = money - cost

            # Return the selected item and any change due
            return (item, change)
        else:
            # If the user has not inserted enough money, return an empty string as the selected item and the full amount of money as change
            return ('', money)
    else:
        # If the selected item is not available, return an empty string as the selected item and the full amount of money as change
        return ('', money)

