class Chef:
    def __init__(self, name, specialty):
        self.name = name
        self.specialty = specialty
        self.skill_set = {
            "pasta": 8,
            "pizza": 9,
            "risotto": 7,
            "soups": 6,
            "salads": 5
        }

    def assess_skill_set(self):
        print(f"Assessment of {self.name}'s skill set:")
        for dish, score in self.skill_set.items():
            print(f"{dish}: {score}/10")

    def improve_skill(self, dish, improvement):
        if dish in self.skill_set:
            self.skill_set[dish] += improvement
            print(f"{self.name} has improved their {dish} skills by {improvement} points.")
        else:
            print("Invalid dish. Please choose from pasta, pizza, risotto, soups, or salads.")

    def display_specialty(self):
        print(f"{self.name} specializes in {self.specialty} cuisine.")


# Example usage
chef = Chef("Marco", "Italian")
chef.display_specialty()
chef.assess_skill_set()

chef.improve_skill("pasta", 2)
chef.improve

