class Node:
    def __init__(self, data=None):
        self.data = data
        self.next = None

class LinkedList:
    def __init__(self):
        self.head = None

    def append(self, data):
        if not self.head:
            self.head = Node(data)
        else:
            current = self.head
            while current.next:
                current = current.next
            current.next = Node(data)

    def reverse(self):
        prev_node = None
        current_node = self.head
        while current_node:
            next_node = current_node.next  # Store next node temporarily
            current_node.next = prev_node     # Reverse link
            prev_node = current_node          # Move prev and current one step forward
            current_node = next_node
        self.head = prev_node

    def print_list(self):
        current_node = self.head
        while current_node:
            print(current_node.data, end=" ")
            current_node = current_node.next
        print()

