Here's an expression in JavaScript that reverses a string without using built-in methods like "reverse()" or "split()". This implementation has a time complexity of O(n), where n is the length of the input string.

```javascript
function reverseString(str) {
    let reversedStr = '';
    for (let i = str.length - 1; i >= 0; i--) {
        // Check if the character is uppercase or lowercase and add it to the reversed string accordingly.
        if (str[i] === str[i].toUpperCase()) {
            reversedStr += str[i].toUpperCase();
        } else {
            reversedStr += str[i];
        }
    }
    return reversedStr;
}

