/* Define a function to generate CSS styles */
function generateCssStyles(element) {
    // Get all descendant elements
    const descendants = Array.from(element.querySelectorAll('*'));

    // Set font size, color, and weight for each descendant element
    descendants.forEach((descendant) => {
        descendant.style.fontSize = '26px';
        descendant.style.color = '#333333';
        descendant.style.fontWeight = 'bold';
    });

    // Return the generated CSS styles as a string
    return descendants.map((descendant) => {
        const style = descendant.style;
        return `${element.tagName.toLowerCase()} > ${descendant.tagName.toLowerCase()}: { font-size: ${style.fontSize}; color: ${style.color}; font-weight: ${style.fontWeight}; }`;
    }).join('\n');
}

