    for i in range(len(points)):
        dist_dict = {}
        for j in range(i + 1, len(points)):
            if points[j][0] - points[i][0] == 0:
                continue
            dist = abs(points[j][1] - points[i][1])
            if dist not in dist_dict:
                dist_dict[dist] = 1
            else:
                dist_dict[dist] += 1
        for k in range(i + 1, len(points)):
