function isPrime(num) {
  if (num <= 1) return false;
  if (num === 2) return true;
  if (num % 2 === 0) return false;

  for (let i = 3; i * i <= num; i += 2) {
    if (num % i === 0) return false;
  }

  return true;
}

function sumFirstNPrimes(arr, n) {
  let primeSum = 0;
  let count = 0;

  for (let i = 0; i < arr.length && count < n; i++) {
    if (isPrime(arr[i])) {
      primeSum += arr[i];
      count++;
    }
  }

  return primeSum;
}
```

